import React from 'react';
import logo from '../assets/logo.svg';
const NavBar = () => {
    return (
        <div className="flex items-center justify-between p-4">

            <img src={logo} alt="logo" className="h-8" />
            <nav className="flex-grow text-center">
                <ul className="flex justify-center space-x-8">
                    <li className="text-lg font-semibold hover:text-blue-500"><a href="#">Home</a></li>
                    <li className="text-lg font-semibold hover:text-blue-500"><a href="#">Feature</a></li>
                    <li className="text-lg font-semibold hover:text-blue-500"><a href="#">Blog</a></li>
                    <li className="text-lg font-semibold hover:text-blue-500"><a href="#">Testimonials</a></li>
                </ul>
            </nav>

            <div className="flex space-x-4">
                <button className="px-6 py-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600">Login</button>
                <button className="px-6 py-2 border border-blue-500 text-blue-500 rounded-lg hover:bg-blue-500 hover:text-white">Sign Up</button>
            </div>
        </div>

    );
};

export default NavBar;
